    t.pendown()
    t.setheading(270)
    t.forward(60)
    t.penup()
    t.goto(-75, 300)
    t.setheading(225)
    t.forward(60)
    t.pendown()
    t.forward(60)
    t.penup()
    t.goto(-75,300)
    t.setheading(135)
    t.forward(60)
    t.pendown()
    t.forward(60)
    t.penup()
    t.goto(-75, 300)
    t.setheading(45)
    t.forward(60)
    t.pendown()
    t.forward(60)
    t.penup()
    t.goto(-75, 300)
